export default class Console {
    static LOG_INTERCEPTOR: ((emitter: any, message: any) => void) | null;
    static WARNING_INTERCEPTOR: ((emitter: any, message: any) => void) | null;
    static ERROR_INTERCEPTOR: ((emitter: any, err: any) => void) | null;
    static stringifyEmitter(emitter: any): string;
    static log(emitter: any, message: any): void;
    static warn(emitter: any, message: any): void;
    static error(emitter: any, err: any): void;
    private constructor();
}
